function ProtectedWrapper() {
  const navigate = useNavigate();
  const hasSession = document.cookie.includes("session_id_name");

  if (!hasSession) {
      navigate('/');
      return null; // Return null or some loading placeholder, so the rendering does not proceed with the ConfigForm
  }

  return <ConfigForm />;
}

function App() {
  return (
      <div className="app-container">
          <Background />
          <div className="content-container">
              <Router>
                  <Routes>
                      <Route path="/" element={<TokenForm />} />
                      <Route path="/config" element={<ProtectedWrapper />} />
                  </Routes>
              </Router>
          </div>
      </div>
  );
}
